window.bookSummaryJSON = "<p><b>More monster girls. More branding. More world conquering.</b></p> <p>After their first victory over the vile slavers that control Etria, William and his harem turn to the heart of the barony to seek allies. But when William finds out that the baroness has turned savage, it's up to him and his brand to stop her.</p> <p>Now, he's going to do what he does best, kick ass and save monster girls.</p> <p>And hey, if that means he'll have to face the Queen Bee herself, well, that's what a magical branding iron is for, now isn't it? </p> <p>Get ready to get slaved.</p> <p>Warning: Contains a harem and adult situations. You have been warned.</p>"; 
